function.textSource:
      function AfterPForm return boolean is
begin
  
	if :p_param6='A' then
		:p_where := 'and  s.socfer is null ';
	else
		if :p_param6='F' then
			:p_where := 'and  s.socfer is not null ';
		else
			:p_where := 'and  1=1 ';
		end if;
	end if;


  
  --srw.message(1,:P_where);  
  
  return (TRUE);
end;

      function R_typeFormatTrigger return boolean is
begin
  if :P_param6='A'or :dc_type='A' then
  	return (TRUE);
  else
	return (FALSE);
  end if;
end;

      function R_type1FormatTrigger return boolean is
begin
  if :P_param6='F'or :dc_type='F' then
  	return (TRUE);
  else
	return (FALSE);
  end if;
end;
